Raya terdiri dari Kakaskasen 1.2.3.dan Kakaskasen) dan di bagian Barat terdapat Desa Wailan dan Kayawu. Pusat pemerintah Kecamatan Tomohon Utara berada di Kelurahan Kakaskasen III yakni di jalan menuju ke Kelurahan Wailan dan Kayawu. Di Kelurahan Kakaskasen III dulunya berlokasi Kantor Wali kota Tomohon,di kompleks Militer Rindam XIII Mdk, tetapi sejak Maret 2008 Kantor Wali kota pindah ke lokasi yang baru di Kelurahan Kolongan, Kecamatan Tomohon Tengah.Kompleks Militer yg pernah digunakan sementara menjadi Kantor Walikota Tomohon, telah dimanfaatkan kembali oleh Rindam XIII Merdeka.</p>\r\n<p style=\"text-align: justify;\">Kepala Kecamatan :&nbsp;<strong>RICKYANTO UNTUNG SUPIT</strong></p>','2023-08-16 03:54:13','2023-08-21 11:56:08'),(2,'Tomohon Barat','<table style=\"border-collapse: collapse; width: 1012pt;\" border=\"0\" width=\"1347\" cellspacing=\"0\" cellpadding=\"0\"><colgroup><col style=\"mso-width-source: userset; mso-width-alt: 4900; width: 101pt;\" width=\"134\"> <col style=\"mso-width-source: userset; mso-width-alt: 3181; width: 65pt;\" width=\"87\"> <col style=\"mso-width-source: userset; mso-width-alt: 3437; width: 71pt;\" width=\"94\"> <col style=\"width: 48pt;\" span=\"3\" width=\"64\"> <col style=\"mso-width-source: userset; mso-width-alt: 2048; width: 42pt;\" width=\"56\"> <col style=\"width: 48pt;\" width=\"64\"> <col style=\"mso-width-source: userset; mso-width-alt: 3401; width: 70pt;\" width=\"93\"> <col style=\"mso-width-source: userset; mso-width-alt: 2194; width: 45pt;\" width=\"60\"> <col style=\"mso-width-source: userset; mso-width-alt: 4132; width: 85pt;\" width=\"113\"> <col style=\"width: 48pt;\" width=\"64\"> <col style=\"mso-width-source: userset; mso-width-alt: 3401; width: 70pt;\" width=\"93\"> <col style=\"width: 48pt;\" span=\"2\" width=\"64\"> <col style=\"mso-width-source: userset; mso-width-alt: 3840; width: 79pt;\" width=\"105\"> <col style=\"width: 48pt;\" width=\"64\"> </colgroup>\r\n<tbody>\r\n<tr style=\"mso-height-source